      <div>
        <a href="https://www.linkedin.com/in/manami-ueda/" target="_blank">
          <img src={linkedin} className="Linkedin" alt="linkedin"></img>
        </a>
      </div>
      <span> Â© Manami Ueda, 2020 All rights reserved. </span>
    </div>
  );
}

export default Footer;
